	VALUES ('Software Engineer', 'Engineering', 'As a Software Engineer (Associate) in Kainos, you’ll be responsible for developing high quality solutions which delight our customers and impact the lives of users worldwide. You’ll do this whilst learning about new technologies and approaches, with talented colleagues that will help you to learn, develop and grow.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%2D%20Software%20Engineer%20%28Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', 3, 1, 2),
    ('Data Engineer', 'Data Engineering', 'As a Data Engineer (Associate) in Kainos you will work within a multi-skilled agile team to design and develop large-scale data processing software to meet user needs in demanding production environments.  Your responsibilities will include:  •Working to develop data processing software primarily for deployment in Big Data technologies. The role encompasses the full software lifecycle including design, code, test and defect resolution.  •Collaborating with colleagues to resolve implementation challenges and ensure code quality and maintainability remains high. •Working with operations teams to ensure operational readiness •Working with other team member to advise on the estimated effort and possible technical implications of user stories and user journeys.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Data%20Engineer%20%28As%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '3', '1', '13'),
    ('AI Engineer', 'AI Engineering', 'As an Artificial Intelligence (AI) Engineer in Kainos, you’ll be responsible for developing high quality solutions which integrate AI and ML technologies that delight our customers and impact the lives of users worldwide. You’ll do this whilst learning about new AI technologies, frameworks and approaches, with talented colleagues that will help you to learn, develop and grow.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence%2FJob%20Profile%20%2D%20Associate%20AI%20Engineer%20%28Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence&p=true&ga=1', '3', '1', '16'),
    ('Test Engineer', 'Testing & Quality Assurance', 'As a Test Engineer (Associate) in Kainos, you’ll work within a multi-skilled agile team, developing and executing functional automated and manual tests to help the team deliver working application software that meets user needs. You’ll do this whilst learning about new technologies and approaches, with talented colleagues who will help you learn, develop and grow.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%20Test%20Engineer%20%28Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering', '3', '1', '4'),
    ('Security Engineer', 'Security Engineering', 'As a Security Engineer, you will work in close collaboration with our technology teams to design and implement secure, cloud-based software solutions for our clients. Working as part of a multi-disciplinary Agile team, you will implement DevSecOps practices throughout the software development lifecycle, embedding security practices (e.g. vulnerability management, threat modelling etc.) and automating security artifact generation (e.g. secret scanning, container security, SAST, DAST etc.). You will provide subject matter expertise in application security or cloud security – sharing knowledge on threats and vulnerabilities, identifying appropriate security controls, and increasing cyber security awareness within teams.Your key responsibilities will include: •Daily collaboration with the application development and cloud platform teams toplan and prioritise security requirements as part of the secure software development lifecycle (SSDLC).•Recommending security best practices for cloud pl', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FCyber%20Security%2FJob%20profile%20%2D%20Security%20Engineer%20%28Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FCyber%20Security&p=true&ga=1', '3', '1', '19'),
    ('Data Analyst', 'Analysis & Data Architecture', 'As a Data Analyst (Associate) in Kainos, you’ll be responsible for matching the needs of data insight with understanding of the available data. Data analysts work closely with customers to produce insight products including reports, dashboards and visualisations but also contribute to project understanding of existing data structures so that inputs and outputs are fully understood.  Most of our work comes through repeat business and direct referrals, which comes down to the quality of our people. The success of our Data Engineering teams means that customers are bringing us an increasing number of exciting data projects using cutting-edge technology to solve real-world problems. We are seeking more high calibre people to join our Data & Analytics capability where you will grow and contribute to industry-leading technical expertise.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Data%20Analyst%20%28As%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '3', '3', '14'),
	('Trainee Software Engineer', 'Engineering', 'As a Trainee Software Engineer with Kainos, you will work on projects where you can make a real difference to people’s lives – the lives of people you know. After taking part in our award-winning, seven-week Engineering Academy, you will then join one of our many project teams, to learn from our experienced developers, project managers and customer-facing staff. You’ll have great support and mentoring, balanced with the experience of being given real, meaningful work to do, to help you truly develop both technically and professionally. You will be responsible for:•Contribute to developing high quality solutions which impact the lives of users worldwide. •You’ll work as part of a team to solve problems and produce innovative software solutions. •Learn about new technologies and approaches, with talented colleagues who will help you learn, develop and grow. •Based in our Kainos office and often on our customer sites, you will work on a project teams to learn how to develop and unit test ', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%2D%20Software%20Engineer%20%28Trainee%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', '2', '1', '2'),
	('Trainee Data Analyst', 'Analysis & Data Architecture', 'The Trainee Data Analyst is responsible for matching the needs of data insight with understanding of the available data. Data analysts work closely with customers to produce insight products including reports, dashboards and visualisations but also contribute to project understanding of existing data structures so that inputs and outputs are fully understood. ', 'NA\'', '2', '3', '14'),
	('Senior Data Analyst', 'Analysis & Data Architecture', 'As a Senior Data Analyst (Senior Associate) at Kainos, you’ll be responsible for matching the needs of data insight with understanding of the available data. Data analysts work closely with customers to produce insight products including reports, dashboards and visualisations but also contribute to project understanding of existing data structures so that inputs and outputs are fully understood. It therefore has a strong consulting element.Most of our work comes through repeat business and direct referrals, which comes down to the quality of our people. The success of our Data Engineering teams means that customers are bringing us an increasing number of exciting data projects using cutting-edge technology to solve real-world problems. We are seeking more high calibre people to join our Data & Analytics capability where you will grow and contribute to industry-leading technical expertise.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Senior%20Data%20Analyst%20%28SA%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '4', '3', '14'),
	('Senior Data Engineer', 'Data Engineering', 'As a Senior Data Engineer (Senior Associate) at Kainos, you will be responsible or designing and developing data processing and data persistence software components for solutions which handle data at scale. Working in agile teams, Senior Data Engineers provide strong development leadership and take responsibility for significant technical components of data systems . You will work within a multi-skilled agile team to design and develop large-scale data processing software to meet user needs in demanding production environments.Your responsibilities will include:•Working to develop data processing software primarily for deployment in Big Data technologies. The role encompasses the full software lifecycle including design, code, test and defect resolution.•Working with Architects and Lead Engineers to ensure the software supports non-functional needs.•Collaborating with colleagues to resolve implementation challenges and ensure code quality and maintainability remains high. Leads by exam', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Senior%20Data%20Engineer%20%28SA%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '4', '1', '13'),
	('Senior Software Engineer', 'Engineering', 'As a Senior Software Engineer (Senior Associate) in Kainos, you’ll be responsible for developing high quality solutions which delight our customers and impact the lives of users worldwide. It’s a fast-paced environment so it is important for you to make sound, reasoned decisions. You’ll do this whilst learning about new technologies and approaches, with talented colleagues that will help you to learn, develop and grow as you, in turn, mentor those around you.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%2D%20Senior%20Software%20Engieneer%20%28Senior%20Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', '4', '1', '2'),
	('Senior AI Engineer', 'AI Engineering', 'As a Senior Artificial Intelligence (AI) Engineer in Kainos, you’ll be responsible for developing high quality solutions that use AI and ML technologies which delight our customers and impact the lives of users worldwide. It’s a fast-paced environment so it is important for you to make sound, reasoned decisions. You’ll do this whilst learning about new technologies and approaches, with talented colleagues that will help you to learn, develop and grow as you, in turn, mentor those around you.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence%2FJob%20Profile%20%2D%20Senior%20AI%20Engineer%20%28Senior%20Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence&p=true&ga=1', '4', '1', '16'),
	('Senior Test Engineer', 'Testing & Quality Assurance', 'As a Senior Test Engineer (Senior Associate) in Kainos, you’ll work within a multi-skilled agile team, developing and executing functional automated and manual tests to help the team deliver working application software that meets user needs. You’ll do this whilst learning about new technologies and approaches, with talented colleagues who will help you learn, develop and grow.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FTesting%2FJob%20profile%20%2D%20Senior%20Test%20Engineer%20%28Senior%20Associate%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FTesting&p=true&ga=1', '4', '1', '4'),
	('Solution Architect', 'Engineering', 'As a Solution Architect (Manager) in Kainos, you’ll be responsible for leading multi-skilled agile teams to design and deliver high quality solutions which delight our customers and impact the lives of users worldwide. You’ll work with customer architects to agree functional and non-functional designs, advising customers and managers on the estimated effort, technical implications and complexity surrounding your designs. You’ll manage, coach and develop a small number of staff, with a focus on managing employee performance and assisting in their career development. You’ll also provide direction and leadership for your team as you solve challenging problems together. As a technical leader, you will work with your peers to develop policy and standards, share knowledge and mentor those around you. You’ll do this whilst advising about new technologies and approaches, with room to learn, develop and grow.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20Profile%20%2D%20Solution%20Architect%20%28Manager%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', '4', '1', '2'),
	('Data Solution Architect', 'Analysis & Data Architecture', 'As a Data Solution Architect (Manager) in Kainos, you’ll be responsible for a multi- skilled agile teams to design and deliver contemporary data solutions. You will be a quality orientated pragmatist, where you balance trade-offs to successfully deliver complex solutions. You will be viewed as an authority figure for data technology solutions, providing strong technical and thought leadership.Your responsibilities will include:•Successfully implementing functional and non-functional designs•Working closely with Ops and Infrastructure architects to productionise robust, resilient, and maintainable data solutions •Working closely with customer architects to agree functional and non-functional designs. Advising, questioning, informing, and helping the customer in making sound solution design outcomes. •Working with your peers to develop policy and standards, share knowledge and mentor those around you•Managing and estimating timelines underpinning solution delivery•Owning technical soluti', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Data%20Solution%20Architect%20%28M%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '6', '3', '14'),
	('Lead Solution Architect', 'Engineering', 'As a Principal Architect (Principal) in Kainos, you’ll be accountable for successful delivery of large-scale high-quality solutions which delight our customers and impact the lives of users worldwide. You will provide assurance and support to multi -skilled agile teams by understanding the outcomes the solution is trying to achieve, the technical implications and complexity surrounding you and your teams\' designs and helping teams make the right decisions. You’ll work with senior stakeholders to agree architectural principles, strategic direction and functional and non-functional designs. You\'ll manage other architects and engineers in the capability to help them navigate their careers.As a technical leader, you will work with your colleagues to lead development of policy and standards, develop customer relationships, develop account strategies and share knowledge and mentor those around you. You’ll do this whilst advising about new technologies and approaches, with room to learn, deve', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20Profile%20%2D%20Principal%20Architect%20%28Principal%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', '7', '1', '2'),
	('Lead Software Engineer', 'Engineering', 'As a Lead Software Engineer (Consultant) in Kainos, you’ll be responsible for leading teams and developing high quality solutions which delight our customers and impact the lives of users worldwide. It’s a fast-paced environment so it is important for you to make sound, reasoned decisions. You’ll do this whilst learning about new technologies and approaches, with talented colleagues that will help you to learn, develop and grow. You’ll manage, coach and develop a small number of staff, with a focus on managing employee performance and assisting in their career development. You’ll also provide direction and leadership for your team as you solve challenging problems together. As the technical leader in the team, you will also interact with customers, share knowledge and mentor those around you.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%2D%20Lead%20Software%20Engineer%20%28Consultant%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering&p=true&ga=1', '5', '1', '2'),
	('Lead AI Engineer', 'AI Engineering', 'As a Lead Artificial Intelligence (AI) Engineer in Kainos, you’ll be responsible for leading teams and developing high quality AI and ML solutions which delight our customers and impact the lives of users worldwide. It’s a fast-paced environment so it is important for you to make sound, reasoned decisions. You’ll do this whilst learning about new technologies and approaches, with talented colleagues that will help you to learn, develop and grow. As the technical leader in the team, you will also lead projects, interact with customers, share knowledge, provide thought leadership and mentor those around you.You will manage, coach and develop a small number of staff, with a focus on managing employee performance and assisting in their career development. You’ll also provide direction and leadership for your team as you solve challenging problems together.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence%2FJob%20Profile%20%2D%20Lead%20AI%20Engineer%20%28Consultant%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FArtificial%20Intelligence&p=true&ga=1', '5', '1', '16'),
	('Lead Test Engineer', 'Testing & Quality Assurance', 'As a Lead Test Engineer (Consultant) in Kainos, you’ll be a technical leader and innovator in software testing, providing strong test leadership and direction within a multi-skilled agile team. Taking responsibility for the strategy, design and development of automated, manual, and non-functional tests, you’ll help the team to deliver working application software that meets user needs and is of sufficient quality for promotion to users. It’s a fast-paced environment so it is important for you to make sound, reasoned decisions. You’ll do this whilst learning about new technologies and approaches, with talented colleagues who will help you learn, develop and grow.You’ll manage, coach and develop a small number of staff, with a focus on managing employee performance and assisting in their career development. You’ll also provide direction and leadership for your team as you solve challenging problems together.As a technical leader in the team, you will also interact with customers, share k', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FEngineering%2FJob%20profile%20%2D%20Lead%20Test%20Engineer%20%28Consultant%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FEngineering', '5', '1', '4'),
	('Lead Data Engineer', 'Data Engineering', 'As a Data Engineer (Associate) in Kainos you will work within a multi-skilled agile team to design and develop large-scale data processing software to meet user needs in demanding production environments. Your responsibilities will include: •Working to develop data processing software primarily for deployment in Big Data technologies. The role encompasses the full software lifecycle including design, code, test and defect resolution. •Collaborating with colleagues to resolve implementation challenges and ensure code quality and maintainability remains high. •Working with operations teams to ensure operational readiness •Working with other team member to advise on the estimated effort and possible technical implications of user stories and user journeys.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Lead%20Data%20Engineer%20%28C%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '5', '1', '13'),
	('Test Architect', 'Testing & Quality Assurance', 'As a Test Architect (Manager) in Kainos, you’ll be responsible for ensuring we deliver high quality solutions which delight our customers and impact the lives of users worldwide.As an experienced test practitioner, you’ll lead our clients and the wider market on better testing and quality, whilst working with client stakeholders to agree a strategy for testing that addresses the needs of fast-changing digital services.You’ll do this whilst advising Kainos about new tools and approaches, working with your peers to develop policy and standards, share knowledge and mentor those around you, with room to learn, develop and grow. You’ll manage, coach and develop a small number of staff, with a focus on managing employee performance and assisting in their career development.As a technical leader in the team, you will also interact with customers, share knowledge and mentor those around you. You’ll also provide direction and leadership for your team as you solve challenging problems together.', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FTesting%2FJob%20profile%20%2D%20Test%20Architect%20%28Manager%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FTesting&p=true&ga=1', '6', '1', '4'),
	('Data Architect (Consultant)', 'Analysis & Data Architecture', 'As a Data Migration Architect (Consultant) at Kainos, you will be responsible for designing and leading the successful implementation of migration activities covering scenarios such as data migrations to support new digital services andcloud analytic platforms, and database migration within a cloud adoption program.You will understand commercial constraints and ensurethat all technology decisions satisfy both commercial and technical success criteria. You will be comfortable in liaising with clients and representing the technical face of Kainos externally.You will provide strong technical competence within Kainos. You will continuously innovate, managerisk appropriately and ensurethat Kainos’ and client’s capabilities are enhanced. You will devise and cost significant solutions from scratch. You willdefine technical direction both within Kainos and throughout project teams.You will actively maintain a current knowledge of technology, disseminate this knowledge at all levels, and seek o', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FArchive%2FJob%20profile%20%2D%20Data%20Architect%20%28C%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData%2FArchive&p=true&ga=1', '6', '3', '14'),
	('Data Architect (Manager)', 'Analysis & Data Architecture', 'As a Data Architect (Manager) in Kainos, you’ll be responsible for providing SME guidance in traditional data architecture disciplines around data structures, data flows, data sourcing and data governance. Data Architects work closely with clients to understand their data requirements and take responsibility for ensuring solutions are fit for purpose. They also provide technical leadership for the rest of the team in the area of data. Data Architects may also work at the solution or enterprise level - for example resolving data definition and mastering issues across complex stakeholder environments. Most of our work comes through repeat business and direct referrals, which comes down to the quality of our people. The success of our data projects means that customers are bringing us an increasing number of exciting data projects using cutting-edge technology to solve real-world problems. We are seeking more high calibre people to join our Data & Analytics capability where you will grow ', 'https://kainossoftwareltd.sharepoint.com/people/Job%20Specifications/Forms/AllItems.aspx?id=%2Fpeople%2FJob%20Specifications%2FData%2FJob%20profile%20%2D%20Data%20Architect%20%28M%29%2Epdf&parent=%2Fpeople%2FJob%20Specifications%2FData&p=true&ga=1', '6', '3', '14');



	



